Hi Kousuke, 

Thanks for your interest. Here are the answers to your questions:

1) This is most definitely the Hiverserver2 process. I validated this by tracking the heap space utilised for the hiveserver2 process over time, as connections were opened and closed. 

2) The queries that were being executed were for the most part "LOAD DATA INPATH:"

{code}

int returnCode = hc.update("LOAD DATA INPATH \'"+fileName +"\' " +
					"OVERWRITE INTO TABLE "+targetTable+" partition (dt=\'"+cal.getTimeInMillis()+"\')");
			logger.info(this.getClass()+ " returned with value "+returnCode);			
{code}

These were a mix of successes, and exceptions. I've yet to validate if the leak occurs in all instances, or in those cases where the hiveserver throws Exceptions.

3) I've not had the time to dig into the hiveserver code as yet to find the offending object, but if I do get the chance, I will certainly post my findings and a patch.

I found the instance of Hashtable$Entry continuing to increase. This is caused by two reasons as follows.

1. opHandle wouldn't release if Exception is thrown during executing query or command
When Exception is thrown during executing query or command, operation handle object will not be released from Map (OperationManager#handleToOperation) because opHandleSet.add(opHandle) will not be executed in HiveSessionImpl (Hiveserver2 side) and execResp.getOperationHandle() will not be executed in HiveStatement (JDBC Client side).

{code}
