          .newExecuteStatementOperation(getSession(), statement, confOverlay, runAsync);
      opHandle
      operation.run();                                                                                   <--------------- Throws exception and cannot get handle.
      OperationHandle opHandle = operation.getHandle();
      opHandleSet.add(opHandle);
      return opHandle;
    } finally {
      release();
    }
  }
{code}

